module `IP_MODULE_NAME(efx_axi_stream_switch) #(
    parameter ARB_MODE        = "ROUND_ROBIN_1",                   
    parameter S_PORTS         = 4,                                 
    parameter M_PORTS         = 2,                                 
    parameter DATA_BYTE       = 1,                                 
    parameter DEST_WIDTH      = 2,                                 
    parameter USER_WIDTH      = 8,                                 
    parameter ID_WIDTH        = 8,                                 
    parameter MAX_XFER_BYTE   = 0,                                 
    parameter MAX_TVALID_LOW  = 0,                                 
    parameter TLAST_EN        = 1,                                 
    parameter DATA_WIDTH      = DATA_BYTE*8,                       
    parameter M_CONNECT       = {M_PORTS{{S_PORTS{1'b1}}}},
